import Stats from './stats';
import Stopwatch from "./Stopwatch";

const Header = ({Players, Title}) => {
  const {players, title } = props;
    return (
      <header>
      <Stats players={players}></Stats>
        <h1>{title}</h1>
        <Stopwatch></Stopwatch>
      </header>
    );
  }

  export default Header;
